import cv2
import numpy as np
from sklearn.svm import SVC

signs = {
    'Главная дорога': '',
    'Стоянка запрещена': '',
    'Крутой подъем': '',
    'Подача звукового сигнала запрещена': '',
    'Ограничение максимальной скорости': '',
    'Дети': '',
    'Дорожные работы': '',
    'Железнодорожный переезд без шлагбаума': '',
    'Пешеходный переход': '',
    'Велосипедная дорожка': ''}


inp_img = np.frombuffer(bytes([int(i, 16) for i in input().split()]), np.uint8)
img = cv2.imdecode(inp_img, cv2.IMREAD_COLOR)
img = cv2.cvtColor(img, cv2.COLOR_BGR2GRAY)
img = cv2.resize(img, (150, 150))

sgn = list(signs.keys())
mx = 0
sg = ''

for s in sgn:
    
    img_compare = bytes.fromhex(signs[s])
    img_compare = np.frombuffer(img_compare, dtype=np.uint8)
    img_compare = img_compare.reshape((150, 150))

    res = cv2.matchTemplate(img, img_compare, cv2.TM_CCOEFF_NORMED)[0][0]
    if res > 0.75:
        mx = res
        sg = s

for s in list(signs.keys()):
    img_compare = bytes.fromhex(signs[s])
    img_compare = np.frombuffer(img_compare, dtype=np.uint8)
    gray = img_compare.reshape((150, 150))
    signs[s] = gray.flatten()

X, y = np.array(list(signs.values())), np.array(list(signs.keys()))

model = SVC(kernel='linear')
model.fit(X, y)

img = img.flatten()
prediction = model.predict([img])[0]

if sg == prediction:
    print(sg)
else:
    print("Знак неизвестен")